import React from 'react';
import { Footer } from '../../../../component/major/Footer';
import { Navbar } from '../../../../component/major/Navbar';

import chevron_left from '../../../../asset/icon/chevron-left.svg'

export const Learning = () => {
    return (
        <>
            <div>
                <Navbar/>
                    <div className='px-5 md:px-20 lg:px-32'>
                        <div className='poppins-600 text-25 bg-gradient-purple-to-pink text-white flex items-center px-16 py-16 mt-16 rounded-2xl text-left'>
                            <img src={chevron_left} alt="" className=''/>
                            <p>Internet of Things</p>
                        </div>
                        <div></div>
                    </div>
                <Footer/>
            </div>
        </>
    )
};
